// src/PrivateRoute.jsx
import React from 'react';
import { Navigate } from 'react-router-dom';

const PrivateRoute = ({ utente, children }) => {
  if (!utente) {
    return <Navigate to="/" />;
  }
  return children;
};

export default PrivateRoute;
